import SHOP_DATA from '../../pages/shop/shop.data'

const initialState = {
  collections: SHOP_DATA,
}

const collectionsReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state
  }
}

export default collectionsReducer
